import React, { useState } from "react";

import {
  EuiFieldText,
  EuiFormRow,
  EuiDualRange,
  EuiSwitch,
  EuiPanel,
  EuiSpacer,
  EuiDatePicker,
  EuiDatePickerRange,
} from "@elastic/eui";

import { htmlIdGenerator } from "@elastic/eui/lib/services";

const SidePanel = () => {
  const idPrefix = htmlIdGenerator()();
  const [isSwitchChecked, setIsSwitchChecked] = useState(false);
  const [dualValue, setValue] = useState([0, 100]);

  const onDualChange = (e) => {
    setValue(e.target.value);
  };

  const onSwitchChange = () => {
    setIsSwitchChecked(!isSwitchChecked);
  };

  return (
    <EuiPanel style={{ maxWidth: 300 }}>
      <EuiFormRow label="Discount Range" display="rowCompressed">
        <EuiDualRange
          id={htmlIdGenerator()()}
          value={dualValue}
          onChange={onDualChange}
          showInput
          minInputProps={{ "aria-label": "Min value" }}
          maxInputProps={{ "aria-label": "Max value" }}
          aria-label="Discount Range Selector"
          compressed
        />
      </EuiFormRow>
      <EuiFormRow
        label="Brand"
        helpText="Enter Brand name to search for.."
        display="rowCompressed"
      >
        <EuiFieldText name="first" compressed />
      </EuiFormRow>
      <EuiFormRow label="Switch" display="rowCompressed" hasChildLabel={false}>
        <EuiSwitch
          label="In Stock?"
          name="switch"
          checked={isSwitchChecked}
          onChange={onSwitchChange}
          compressed
        />
      </EuiFormRow>
      <EuiSpacer size="m" />
      <EuiFormRow
        label="Date Range"
        helpText="Manufacture Range"
        display="rowCompressed"
      >
        <EuiDatePickerRange
          startDateControl={
            <EuiDatePicker
              selected={this.state.startDate}
              onChange={this.handleChangeStart}
              startDate={this.state.startDate}
              endDate={this.state.endDate}
              isInvalid={this.state.startDate > this.state.endDate}
              aria-label="Start date"
            />
          }
          endDateControl={
            <EuiDatePicker
              selected={this.state.endDate}
              onChange={this.handleChangeEnd}
              startDate={this.state.startDate}
              endDate={this.state.endDate}
              isInvalid={this.state.startDate > this.state.endDate}
              aria-label="End date"
            />
          }
        />
      </EuiFormRow>
    </EuiPanel>
  );
};

export default SidePanel;
